import React from 'react';
import useTitle from '@Utils/hooks/useTitle';

import fetchFacebook from '@Hooks/facebook/fetchFacebook';
import generateFbToken from '@Utils/hooks/facebook/generateFbToken';
// import { FacebookEmbed } from 'react-social-media-embed';
import { FacebookProvider, EmbeddedPost } from 'react-facebook';

function Actualites() {
	useTitle('G&F87 | Actualites');
	const { token } = generateFbToken();

	const { posts } = fetchFacebook(
		process.env.REACT_APP_FACEBOOK_PAGE_ID,
		'EAASnZBKcZCuIEBAPY2D1LV5ilckAcMKCzxTEQZCvduHOl43VNrwpzL8rWVNbsCWIPeMNJ3rEVdKK4ebgSYcffmZCWkzd8Evf3YGxgZAhDXVCMwMo4QUI7WFBfep8NsfVHMj1sOIu7b0GQjQZAsay0vJMNZCWZABLXViNwuwsddpJpho5veri4l7BHZCvhZArHbyuESyfZBj3HDD8PWzywGGhM6PSo68C4LUIMUZD',
		5
	);

	console.log('Page Id: ' + process.env.REACT_APP_FACEBOOK_PAGE_ID, 'Token: ' + token, 'Datas:' + posts);

	return (
		<div
			style={{
				display: 'flex',
				flexWrap: 'wrap',
				justifyContent: 'center',
			}}
		>
			{posts.map((post) => (
				<FacebookProvider key={post.id} appId={process.env.REACT_APP_FACEBOOK_APP_ID}>
